import React, { Component } from 'react';
import styled from 'styled-components';

const Wrapper = styled.div`

    background-color: #FECDD2;
    min-height: 100vh;
    min-width: 100vw;


`

const Navigation = styled.div`

    width: 1200px;
    height: 100px;
    display: flex;
    position: fixed;
    top: 0;
    left: 50%;
    transform: translateX(-50%);
    background-color: red;
    z-index: 100;

`

const Divider = styled.div`



`    

const Icon = styled.div`

    background-image: url(https://s3-us-west-2.amazonaws.com/s.cdpn.io/3130484/spotify-logo.svg);
    height: 100px;
    width: 200px;
    background-size: contain;
    background-repeat: no-repeat;

`

const Links = styled.div`

    display: flex;

    a {
        font-size: 16px;
        font-weight: 700px;
    }

`

class ErrorPage extends Component {

    state ={}

    render() {
        return(
            <Wrapper>
                <Navigation>
                    <Icon />
                    <Links>
                        <a href="#">Premium</a>
                        <a href="#">Help</a>
                        <a href="#">Download</a>
                        <Divider/>
                        <a href="#">Sign Up</a>
                        <a href="#">Login</a>                    
                    </Links>
                </Navigation>
            </Wrapper>
        )
    }

} 

export default ErrorPage
